package bd.edu.seu.messmanagmentsystem.model;import jdk.nashorn.internal.ir.CallNode;import lombok.AllArgsConstructor;import lombok.Data;import lombok.NoArgsConstructor;import javax.persistence.Column;import javax.persistence.Entity;import javax.persistence.Id;import javax.persistence.OneToOne;import java.time.LocalDate;@Entity@Data@AllArgsConstructor@NoArgsConstructorpublic class Member {    @Id    @Column(name = "Member_Id",length = 20)    private long member_id;    private Name name;    private Address address;    private Phone phone;    @Column(name = "Email",length = 50,nullable = false)    private String email;    @Column(name = "Facebook",length = 50,nullable = false)    private String facebook;    private LocalDate addDate;    @OneToOne    private Manager manager;}